import './workExperienceCSS.css'
import { WorkExperienceModel } from '../model/workExperience';
import {useState, useEffect} from 'react'


function WorkExperience() {


    const [workExperienceFormGroup, setWorkExperienceFormGroup] = useState([{}]);

    function addWorkExperience() {
        setWorkExperienceFormGroup([...workExperienceFormGroup, {}])
        console.log('add work experience plus clicked')
    }


    const [workExperiences, setWorkExperiences] = useState(null)

    useEffect(() => {
        console.log('in use effect')
            const getWorkExperiences = async() => {
                console.log('in function')
                let workExperienceModel = new WorkExperienceModel()

                try {
                    // let educationModel = new EducationModel()
                    let workExperiences = await workExperienceModel.getWorkExperiences()
                    console.log('here')
                    setWorkExperiences(workExperiences)
                }
                catch (error) {
                    console.log('here2');
                    setWorkExperiences(null)
                }
            }
            getWorkExperiences();


    }, [])

    return (
        <div class='container'>
        <form>
            <div class='workExperience-border'>
                <h1 class='workExperience'>Work Experience</h1>
                <hr></hr>

                {workExperiences != null ? workExperiences.map((workExperience) => (
                    <div>
                         <div class='form-group'>
                            <label>Title</label>
                            <input type="text" placeholder='Title'/>
                        </div>

                        <div class='form-group'>
                            <label>Company</label>
                            <input type="text" placeholder='Company'/>
                        </div>

                        {/* change to date picker */}
                        <div class='form-group'>
                            <label>Start Date</label>
                            <input type="text" placeholder='Start Date'/>
                        </div>

                        {/* change to date picker */}
                        <div class='form-group'>
                            <label>End Date</label>
                            <input type="text" placeholder='End Date'/>
                        </div>

                        <div class='form-group'>
                            <label>Currently Work Here</label>
                            <input type="checkbox"/>
                        </div>

                        <div class='form-group'>
                            <label>City, State</label>
                            <input type="text" placeholder="City, State"/>
                        </div>

                        <div class='form-group'>
                            <label>Work Responsibilities</label>
                            <input type="textarea" placeholder="Work Responsibilities"/>
                        </div>
                    </div>
                )) : null}

                <h1 id='plus' onClick={()=>addWorkExperience()}>+</h1>

            </div>
        </form>

    </div>
    )
}

export default WorkExperience;
